import React from "react";
import "./Page.css";
import Menu from "./Menu"
import MainLogin from "./MainLogin"

function LoginPage () {

    return (
        <div className="app">
            <div className="center_login">
                <Menu />

                <MainLogin />
            </div>
        </div>
    )

    
}

export default LoginPage
